import { useSelector, useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { useEffect } from "react"
import {logOutRedux} from "../store/user/actions";
const Profile = () => {
  const dispatch = useDispatch()
  const user = useSelector((state) => state.user);
  const navigate = useNavigate()
  useEffect( () => {
    if(user.sessionData.loggedIn === false) {
    navigate("/login")
  }
  },[])
  const logOut = () => {
    dispatch(logOutRedux());
    navigate("/login")
  }
  return <div>
    {user.sessionData.loggedIn ?
      <div className={"mainProfile"}>
        <span className={"profileItem"}> name: <span>{user.users[user.sessionData.email].name}</span> </span>
        <span className={"profileItem"}>lastName: <span>{user.users[user.sessionData.email].lastName} </span></span>
        <span className={"profileItem"}>email: <span>{user.sessionData.email}</span> </span>
        <span className={"profileItem"}> password: <span>{user.sessionData.password}</span></span>
        <span className={"profileItem"}>gender: <span>{user.users[user.sessionData.email].gender}</span></span>
        <button onClick={logOut}>logOut</button>
      </div>
    : null}


  </div>
}
export default Profile
